"use client"

import { useState, useEffect } from "react"
import { View, Text, StyleSheet, Animated, Dimensions, TouchableOpacity } from "react-native"
import { ChevronDown } from "../components/icons"

const { width, height } = Dimensions.get("window")

interface IntroAnimationProps {
  onComplete: () => void
}

const IntroAnimation = ({ onComplete }: IntroAnimationProps) => {
  const [showSkip, setShowSkip] = useState(false)
  const windowOpacity = new Animated.Value(0)
  const windowScale = new Animated.Value(0.9)
  const curtainLeftAnim = new Animated.Value(-width * 0.5)
  const curtainRightAnim = new Animated.Value(width)
  const plantsAnim = new Animated.Value(height)
  const messageOpacity = new Animated.Value(0)
  const skipButtonOpacity = new Animated.Value(0)
  const skipButtonPosition = new Animated.Value(20)

  useEffect(() => {
    // Animate window
    Animated.sequence([
      Animated.parallel([
        Animated.timing(windowOpacity, {
          toValue: 1,
          duration: 1000,
          useNativeDriver: true,
        }),
        Animated.timing(windowScale, {
          toValue: 1,
          duration: 1500,
          useNativeDriver: true,
        }),
      ]),
      // Animate curtains
      Animated.parallel([
        Animated.timing(curtainLeftAnim, {
          toValue: -width * 0.2,
          duration: 1500,
          useNativeDriver: true,
        }),
        Animated.timing(curtainRightAnim, {
          toValue: width * 0.8,
          duration: 1500,
          useNativeDriver: true,
        }),
      ]),
      // Animate plants
      Animated.timing(plantsAnim, {
        toValue: height * 0.6,
        duration: 1000,
        useNativeDriver: true,
      }),
      // Animate message
      Animated.timing(messageOpacity, {
        toValue: 1,
        duration: 1000,
        useNativeDriver: true,
      }),
    ]).start()

    // Show skip button after a delay
    const timer = setTimeout(() => {
      setShowSkip(true)
      Animated.parallel([
        Animated.timing(skipButtonOpacity, {
          toValue: 1,
          duration: 300,
          useNativeDriver: true,
        }),
        Animated.timing(skipButtonPosition, {
          toValue: 0,
          duration: 300,
          useNativeDriver: true,
        }),
      ]).start()
    }, 3000)

    return () => clearTimeout(timer)
  }, [])

  return (
    <View style={styles.container}>
      <View style={styles.windowContainer}>
        {/* Background night sky */}
        <View style={styles.nightSky}>{/* Stars would be here in a real implementation */}</View>

        {/* Window frame */}
        <Animated.View
          style={[
            styles.windowFrame,
            {
              opacity: windowOpacity,
              transform: [{ scale: windowScale }],
            },
          ]}
        >
          {/* Window panes */}
          <View style={styles.windowPanes}>
            <View style={styles.pane1} />
            <View style={styles.pane2} />
            <View style={styles.pane3} />
            <View style={styles.pane4} />
          </View>
        </Animated.View>

        {/* Curtains */}
        <Animated.View
          style={[
            styles.leftCurtain,
            {
              transform: [{ translateX: curtainLeftAnim }],
            },
          ]}
        />
        <Animated.View
          style={[
            styles.rightCurtain,
            {
              transform: [{ translateX: curtainRightAnim }],
            },
          ]}
        />

        {/* Plants */}
        <Animated.View
          style={[
            styles.plantsContainer,
            {
              transform: [{ translateY: plantsAnim }],
            },
          ]}
        >
          <View style={styles.plant1} />
          <View style={styles.plant2} />
        </Animated.View>

        {/* Message */}
        <Animated.View
          style={[
            styles.messageContainer,
            {
              opacity: messageOpacity,
            },
          ]}
        >
          <Text style={styles.messageTitle}>오늘 하루도 수고하셨어요</Text>
          <Text style={styles.messageSubtitle}>당신의 마음을 기록해보세요</Text>
        </Animated.View>
      </View>

      {/* Skip button */}
      {showSkip && (
        <Animated.View
          style={[
            styles.skipButtonContainer,
            {
              opacity: skipButtonOpacity,
              transform: [{ translateY: skipButtonPosition }],
            },
          ]}
        >
          <TouchableOpacity style={styles.skipButton} onPress={onComplete}>
            <Text style={styles.skipButtonText}>시작하기</Text>
            <ChevronDown color="#FFFFFF" size={16} />
          </TouchableOpacity>
        </Animated.View>
      )}
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#000000",
    justifyContent: "center",
    alignItems: "center",
  },
  windowContainer: {
    width: width * 0.8,
    height: height * 0.6,
    position: "relative",
  },
  nightSky: {
    position: "absolute",
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: "#0a1a2a",
  },
  windowFrame: {
    position: "absolute",
    top: "10%",
    left: "7.5%",
    width: "85%",
    height: "60%",
    borderWidth: 4,
    borderColor: "#1a2a3a",
    borderRadius: 8,
    backgroundColor: "#0a1a2a",
    overflow: "hidden",
  },
  windowPanes: {
    flex: 1,
    flexDirection: "row",
    flexWrap: "wrap",
  },
  pane1: {
    width: "50%",
    height: "50%",
    borderRightWidth: 2,
    borderBottomWidth: 2,
    borderColor: "#1a2a3a",
  },
  pane2: {
    width: "50%",
    height: "50%",
    borderBottomWidth: 2,
    borderColor: "#1a2a3a",
  },
  pane3: {
    width: "50%",
    height: "50%",
    borderRightWidth: 2,
    borderColor: "#1a2a3a",
  },
  pane4: {
    width: "50%",
    height: "50%",
  },
  leftCurtain: {
    position: "absolute",
    top: 0,
    left: 0,
    width: "25%",
    height: "100%",
    backgroundColor: "rgba(26, 42, 58, 0.5)",
  },
  rightCurtain: {
    position: "absolute",
    top: 0,
    right: 0,
    width: "25%",
    height: "100%",
    backgroundColor: "rgba(26, 42, 58, 0.5)",
  },
  plantsContainer: {
    position: "absolute",
    bottom: "20%",
    left: 0,
    right: 0,
    flexDirection: "row",
    justifyContent: "space-around",
    paddingHorizontal: 40,
  },
  plant1: {
    width: 30,
    height: 50,
    backgroundColor: "#1a3a2a",
    borderTopLeftRadius: 15,
    borderTopRightRadius: 15,
  },
  plant2: {
    width: 30,
    height: 40,
    backgroundColor: "#2a4a3a",
    borderRadius: 20,
  },
  messageContainer: {
    position: "absolute",
    bottom: "10%",
    left: 0,
    right: 0,
    alignItems: "center",
  },
  messageTitle: {
    fontSize: 18,
    fontWeight: "bold",
    color: "#FFFFFF",
    marginBottom: 8,
  },
  messageSubtitle: {
    fontSize: 14,
    color: "rgba(255, 255, 255, 0.7)",
  },
  skipButtonContainer: {
    position: "absolute",
    bottom: 40,
  },
  skipButton: {
    flexDirection: "row",
    alignItems: "center",
    padding: 12,
  },
  skipButtonText: {
    color: "#FFFFFF",
    fontSize: 16,
    marginRight: 8,
  },
})

export default IntroAnimation
